import React from "react";

function importAll(r) {
  let images = {};
  r.keys().map((item, index) => {
    images[item.replace("./", "")] = r(item);
  });
  return images;
}

const images = importAll(require.context("../static/pokemon", false, "/.jpg/"));

class App extends React.Component {
  render() {
    console.log(`$pokemon/0002_000_mf_n.png`);
